import React from "react";
import Link from "react-router-dom";

const Menu = () => (
  <div>
    <Link to="/">Home</Link>
    <Link to="/signup">Sign up</Link>
    <Link to="/singnin">sign in</Link>
  </div>
);

export default Menu;
